import { Fab, Tooltip } from '@mui/material'
import AddIcon from '@mui/icons-material/Add';

import React from 'react'

function Add() {
    return (
        <div>
            <Tooltip title="Delete">
                <Fab color="primary" aria-label="add">
                    <AddIcon />
                </Fab>
            </Tooltip>
        </div>
    )
}

export default Add
